#Para lidar/ter acesso ao sistema operacional
import os

#Para lidar com visão computacional, leitura de imagens
import cv2

#Biblioteca no Google para lidar com deep learning e redes neurais
import tensorflow as tf

#Acessa a recursos matemáticos
import numpy as np

#Para camadas das redes neurais e os pesos delas
from tensorflow.keras import layers, optimizers

#Rede Neural Convolucional
from tensorflow.keras.applications import ResNet50

#Para conectar os neurônios
from tensorflow.keras.layers import Input, Dense, AveragePooling2D, Dropout, Flatten

