#Para salvar os pesos da rede neural
from tensorflow.keras.callbacks import ModelCheckpoint

#Para fazer a criação de gráficos
import matplotlib.pyplot as plt
import seaborn as sns

#Acessar as pastas do Drive
from google.colab import drive
drive.mount('/content/drive')

#Para acessar os arquivos necessários
xray_directory = '/content/drive/MyDrive/Departamento médico/Dataset'

#Teste para ver se conseguimos acessar a pasta
os.listdir(xray_directory)

#Para acessar as imagens, precisa mudar a escala da imagem, as imagens estão rgb e os pixels são representado de 0 a 255
#Quanto mais perto de 0 mais preto e mais perto de 255 mais branco
#O rescalonamento ajuda no processamento da rede neural
image_generator = ImageDataGenerator(rescale=1./255)

#Buscando as imagens de treinamento
#bacth size = selecionar de 40 a 40 imagens
#shuffle = misturar as imagens da pasta, evita a aprender a ordem das imagens
#target_size = tamanho da imagem, precisa estar de acordo com a estrutura da rede neural que vai usar
#class mode = tipo de classe, no caso são categorias diferentes
#subset = informa que estamos criando as imagens de treinamento
#São 133 imagens em casa classe, são 4 classes -> 133 * 4 = 532 imagens
# 532 / 40 -> 13.3 porções (13 arredondado) de imagens de 40 imagens para usar no treinamento
train_generator = image_generator.flow_from_directory(batch_size = 40, directory=xray_directory,
                                                      shuffle = True, target_size=(256, 256),
                                                      class_mode = 'categorical', subset='training')

#Cada porção de imagens é definido com 40, com 256x256 de altura e 3 numeros de canais (sistema RGB)
train_images, train_labels = next(train_generator)
train_images.shape

#Mostra as classes para cada uma das imagens, são 4 classes, definindo então com 4 neurônios na camada de saída
train_labels

# Covid19->   1 0 0 0
# Normal->    0 1 0 0
# Viral->     0 0 1 0
# Bacterial-> 0 0 0 1
#Essa definição será como iremos aplicar a rede neural
labels_names = {0: 'Covid-19', 1: 'Normal', 2: 'Pneunomia viral', 3: 'Pneunomia bacterial'}

#Textando o np.arrange, itera de 0 à 35
np.arange(0, 36)

