fig, axes = plt.subplots(6, 6, figsize=(12, 12))
axes = axes.ravel()
for i in np.arange(0, 36):
  axes[i].imshow(train_images[i])
  #axes[i].imshow(train_images[i]) -> Só isso já defini, mas os outros parâmetros melhoram a visualização

  #Para adicionar o label de cada imagem
  axes[i].set_title(labels_names[np.argmax(train_labels[i])])

  #Retira os eixos
  axes[i].axis('off')

#Para dar mais espaço entre as imagens
plt.subplots_adjust(wspace=0.5)

"""Redes Neurais Convolucionais
- Uma imagem é enviada para várias camadas que juntas formam um grupo de convolução (layer)
- Essas camadas tem o objetivos de extrair características da imagem (kernels/feature detectors)
- 1 layer engloba kernels/feature detectors
- Essas características são gerais: bordas, linhas, cores, questões básicas da imagem(general features)
- Em cada camada convolucional(layer) geralmente é definido vários detectores(kernels/features detectors), são exemplos 32, 64, 128
- Mais sobre kernels: https://en.wikipedia.org/wiki/Kernel_(image_processing)
- Conforme a imagem passa pelas camadas, as últimas são específicas para classficação(Classification specific layers)
- Redes neurais convolucionais são formadas por general features + classification specific layers. Ou seja, uma parte das camadas é para extrair informações gerais e a outra parte é usada para a classificação final
- As características extraídas da general feature são utiilizadas nas camadas seguintes para formar características mais complexas(pernas, rosto, mãos)
- A segunda etapa está mais relacionada com uma rede neural tradicional
- Sobre redes convolucionais:
  https://medium.com/neuronio-br/entendendo-redes-convolucionais-cnns-d10359f21184

  https://www.deeplearningbook.com.br/introducao-as-redes-neurais-convolucionais/

- Usa a Função ReLU: https://www.deeplearningbook.com.br/funcao-de-ativacao/#:~:text=ReLU&text=ReLU%20%C3%A9%20a%20fun%C3%A7%C3%A3o%20de,neur%C3%B4nios%20ativados%20pela%20fun%C3%A7%C3%A3o%20ReLU.

![image.png](data:image/png;base64,)

Arquiteturas de redes neurais convolucionais:
- LeNet-5
- AlexNet
- ZFNEt
- Googlenet/Inception
- VGGNet
- ResNet (Vamos usar essa!)

    -> Possui o problema do gradiente desaparecendo(vanish gradient problem), porém o conceito de skip connection é aplicado para resolver, basicamente passa a informação original para a próxima camada para não perder esses dados
    
    -> Usa um dataset ImageNet de 11 milhões de imagens e 11k de categorias para ser treinado

*Uma arquitetura que lida com skip conecction e a arquiteutra YOLO para detecção de objetos

- Por meio da técnica de transferência de aprendizagem podemos usar a arquitetura ResNet para resolver o problema de calssificar as imagens
- Uma rede neural ppode ser reusada como ponto de partida para uma tarefa simliar, usando os pesos já aprendidos. Isso ajuda a reduzir o tempo de treinamento

![image.png](data:image/png;base64,)

- Site do Image Net: https://www.image-net.org/
- Vamos fazer o treinamento somente da parte final (New Dense Layers Trianed On Specific Task)
"""

#Carregar a rede neural já treinada
base_model = ResNet50(weights='imagenet', include_top=False,
                      input_tensor = Input(shape=(256,256,3)))

#Para observar as camadas(são muitas!!)
base_model.summary()

#A quantidade de camadas(layers)
len(base_model.layers)

#Para congelar as camadas, ou seja, não é para usar esses pesos para treinar, já está treinado!
#Não treina as 10 últimas camadas - Treina a camada densa e umas poucas da camada convolucional
#Vamos treinar as nossas camadas e mais algumas já existentes, ajuda a se adequar melhor ao nosso cenário
for layer in base_model.layers[:-10]:
    layer.trainable = np.format_float_scientific

#Implementação da parte específica do nosso problema
#Head Model - o cabeçalho da rede neural

#Começa onde termina a base model, conecta
head_model = base_model.output

#Precisa diminuir a dimensionalidade das camadas anteriores porque as nossas são menores
#Faz uma média das existentes
head_model = AveragePooling2D(pool_size=(2, 2))(head_model)

#Parte Flattening, transforma os dados que estavam em matriz para vetores para mandar os pixels para nossa rede neural densa
head_model = Flatten()(head_model)

#Decição arbitrária de quantidade de neurônios
head_model = Dense(256, activation = 'relu')(head_model)

#Aplicação de uma camada para zerar 20% dos 256 neurônios da camada anterior para evistar o overfiting
#Para o algoritmo não se adaptar ao dataset
head_model = Dropout(0.2)(head_model)

#Mais uma camada densa
head_model = Dense(256, activation = 'relu')(head_model)
head_model = Dropout(0.2)(head_model)

#Vamos definir 4 neurônios porque são 4 classes
#softmax = porque tem mais de duas categorias, então usa-se essa ativação
head_model = Dense(4, activation = 'softmax')(head_model)

#Criando a rede neural, indicando o início e o seu fim
model = Model(inputs = base_model.input, outputs = head_model)

#Compilar a rede
#loss = relacionada a função de erro, usamos nesse funções de logarítmos
#optimizer = para trabalhar com o ajuste dos pesos, usamos o algoritmo RMSprop
#metrics = avaliação do algoritmo com o conceito de acurácia
#learning_rate = 1e-4 ->definindo o ritmo de aprendizagem
#Pode tirar o decay=1e-6 se achar necessário, trata de em cada avanço a aprendizagem vai decaindo
model.compile(loss = 'categorical_crossentropy', optimizer=optimizers.RMSprop(learning_rate = 1e-4), decay=1e-6,
              metrics = ['accuracy'])

#Salvar a rede neural
#Seria interessante usar o parâmetro save_best_only=True, mas não temos uma base de dados de validação
checkpointer = ModelCheckpoint(filepath='weights.keras')

#Redefinindo uma variável para o treinamento
#Pega 4 imagens, faz o treinamento e ajusta os pesos, assim em diante
train_generator = image_generator.flow_from_directory(batch_size = 4, directory=xray_directory,
                                                      shuffle = True, target_size=(256, 256),
                                                      class_mode = 'categorical', subset='training')

#Fazendo o treinamento
#epochs = épocas de aprendizagem, bota em 25 ou 50
history = model.fit(train_generator, epochs = 25, callbacks=[checkpointer])

#Avaliar a rede neural, histórico das 25 épocas
history.history.keys()

#Plotar no gráfico
#Usado somente a base de treinamento
plt.plot(history.history['accuracy'])
plt.plot(history.history['loss'])
plt.title('Erro e taxa de acerto durante o treinamento')
plt.xlabel('Época')
plt.ylabel('Taxa de acerto e erro')
plt.legend(['Taxa de acerto', 'Erro']);

