#Testando quantidade de elementos(pastas) = 4
len(os.listdir(test_directory))

#Fazendo uma matrix de confusão
prediction = []
original = []
image = []

for i in range(len(os.listdir(test_directory))):
  for item in os.listdir(os.path.join(test_directory, str(i))):

    #Percorre todas as imagens em todos os diretórios
    #print(os.listdir(os.path.join(test_directory, str(i))))

    #Pega as imagens
    img = cv2.imread(os.path.join(test_directory, str(i), item))

    #Muda o tamando da imagem
    img = cv2.resize(img, (256, 256))

    #Bota dentro de um vetor
    image.append(img)

    #Para colocar na escale de 0 a 1
    img = img / 255

    #Quantidade de imagem (-1 é indeterminado), altura, largura, numero de canais
    img = img.reshape(-1, 256, 256, 3)

    #Fazendo previsão
    predict = model.predict(img)

    #Para buscar o índice que tem a maior probabilidade
    predict = np.argmax(predict)

    #Adicionando na lista de precisão
    prediction.append(predict)

    #Dentro da lista original adicionando a classe correta
    original.append(i)

#As previsões feitas
print(prediction)

#As respostas reais
print(original)

#Começo de uma matriz de confusão e avaliações

